粘着シート取付<br><br>ダッシュボード、ドア、コンソールなど空いたスペースがポケットスペースになります。<br>粘着シートで簡単に貼り付けできます。<br>使わない時はフラットなので邪魔になりません。<br>収納物をネットとゴムでしっかりホールドします。<br>ポケット内側はスポンジ入り柔らか素材を採用し収納物へのショックを柔らげます。<br>緩やかな曲面にも対応する車内専用設計です。<br>メッシュポケット部はネットですので出し入れも簡単です。<br><br>●製品寸法 高×幅×厚(mm)：90×220×8<style type="text/css">
